import React, { useState } from 'react';
import ArrangementDisplay from './ArrangementDisplay';
import api from '../../../services/api';
import { useSelector, useDispatch } from 'react-redux';

import './styles.scss';

const testData = [1,2,3,4,5]

export default function ArrangementWrapper() {
    const [loading, setLoading] = useState(false)
    const authKey = useSelector(state => state.auth.keys)

    const fetchArrangements = (key=authKey) => {
        setLoading(true)
        try {
            const response = api({
                method: 'get',
                url: '/projects',
                headers: {
                    'Authorization': `Bearer ${key[0].key}`
                },
            })
        } catch(e) {
            console.log(e)
        } finally {
            setLoading(false)
        }
    }

    return(
        <div className="arr-wrapper">
            {
                testData.map((index) => (
                    <ArrangementDisplay key={index} />
                ))
            }   
        </div>
    );
}
